body:
We should not adopt the scheme of "first put new elements, then judge the capacity, and if it is full, trigger the proceedEviction() method".Instead, we should adopt the scheme of "first determine the capacity, then trigger the proceedEviction() method if it is full, and finally put in new elements".

## What is the purpose of the change

```
@Test
void testPutAndGet() {
    LFUCache<String, Integer> cache = new LFUCache<>(5, 0.2f);
    for (int i = 0; i < 5; i++) {
        cache.put(i + "", i);
        cache.get(i + "");
    }
    cache.put("why", 18);
    Integer why = cache.get("why");
    System.out.println("why = " + why);
}
```

expect：18
but：null

before fix，when we put new element：first put new elements, then judge the capacity, and if it is full, trigger the proceedEviction() method.

so, "why" be eviction after proceedEviction() method.

Instead, we should adopt the scheme when put：first determine the capacity, then trigger the proceedEviction() method if it is full, and finally put in new elements.


